import styled from "styled-components";

export const PopupWrapper = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  height: 100vh;
  width: 100vw;
  background: #70707040;
  display: flex;
  align-items: center;
  justify-content: center;
`

export const PopupContent = styled.div`
  height: calc(100% - 12.5rem);
  width: calc(100% - 48rem);
  border-radius: 78px;
  background: white;
`
